int rows = sizeof(title_bits) / sizeof(title_bits[0]);

unsigned char screen[200*40];
unsigned char color[25*40];

#define BCOLOR_BLACK            0x00
#define BCOLOR_WHITE            0x01
#define BCOLOR_RED              0x02
#define BCOLOR_CYAN             0x03
#define BCOLOR_PURPLE           0x04
#define BCOLOR_GREEN            0x05
#define BCOLOR_BLUE             0x06
#define BCOLOR_YELLOW           0x07
#define BCOLOR_ORANGE           0x08
#define BCOLOR_BROWN            0x09
#define BCOLOR_LEMON            0x0A
#define BCOLOR_LIGHTVIOLET      0x0B
#define BCOLOR_BLUEGREEN        0x0C
#define BCOLOR_LIGHTBLUE        0x0D
#define BCOLOR_DARKBLUE         0x0E
#define BCOLOR_LIGHTGREEN       0x0F

#define CATTR_LUMA0             0x00
#define CATTR_LUMA1             0x01
#define CATTR_LUMA2             0x02
#define CATTR_LUMA3             0x03
#define CATTR_LUMA4             0x04
#define CATTR_LUMA5             0x05
#define CATTR_LUMA6             0x06
#define CATTR_LUMA7             0x07
#define CATTR_BLINK             0x08


unsigned char color_index[] = {
    BCOLOR_BLACK,
    BCOLOR_BLUE,
    BCOLOR_CYAN,
    BCOLOR_WHITE,
    BCOLOR_GREEN,
    BCOLOR_YELLOW,
    BCOLOR_RED
};

unsigned char luma_index[] = {
    CATTR_LUMA0,
    CATTR_LUMA0,
    CATTR_LUMA6,
    CATTR_LUMA7,
    CATTR_LUMA3,
    CATTR_LUMA6,
    CATTR_LUMA2
};

unsigned char counters[15];
unsigned char colors[2];
unsigned char screen_colors[25][40];
unsigned char screen_luma[25][40];
unsigned char screen[25*40*8];

int main() {
    int x, y, c, r;
    unsigned char b;

    printf("\n\n.segment \"TITLEGFX\"\n");
    for(y = 0; y < rows; y+=8) {
        for(x = 0; x < 320; x += 8) {
            memset(counters, 0, 15);
            for(r=0; r < 8; r++) {
                for(c=0; c < 8; c++) {
                    counters[title_bits[y+r][x+c]]++;
                }
            }
            r = 0;
            for(c=0;c<15;c++) {
                if(counters[c]) {
                    colors[r] = c;
                    if(++r > 2) {
                        printf("@ (%02d, %02d) there are more then 2 colors in an 8x8\n", y, x);
                    }
                }
            }

            if(r < 2) {
                colors[1] = 0;
            }

            if(counters[colors[0]] < counters[colors[1]]) {
                unsigned char t = colors[0];
                colors[0] = colors[1];
                colors[1] = t;
            }

            screen_colors[y/8][x/8] = (color_index[colors[0]] << 4) | (color_index[colors[1]] << 0);
            screen_luma[y/8][x/8] = (luma_index[colors[0]] << 0) | (luma_index[colors[1]] << 4);

            printf("\n.byte ");
            for(r=0; r < 8; r++) {
                b = 0;
                for(c=0; c < 8; c++) {
                    b <<= 1;
                    if(title_bits[y+r][x+c] == colors[0]) {
                        b |= 1;
                    }
                }
                printf("$%02X", b);
                if(r < 7) {
                    printf(",");
                }
            }
        }
    }

    printf("\n\n.segment \"TITLELUM\"\n");
    b = 0;
    for(y=0;y<25;y++){
        for(x=0;x<40;x++) {
            if(b == 0) {
                printf("\n.byte ");
            }
            printf("$%02X", screen_luma[y][x]);
            if(++b == 8) {
                b = 0;
            } else {
                printf(",");
            }
        }
    }
    printf("\n\n.segment \"TITLECOL\"\n");
    b = 0;
    for(y=0;y<25;y++){
        for(x=0;x<40;x++) {
            if(b == 0) {
                printf("\n.byte ");
            }
            printf("$%02X", screen_colors[y][x]);
            if(++b == 8) {
                b = 0;
            } else {
                printf(",");
            }
        }
    }

    return 0;
}
